import App from '../App'

const Person = ({ name }) => {
  return (
    <>{name}</>
  )
}

const Persons = ({ persons }) => {

  const returnPerson = (person) =>{
    return (
      <>{persons.map(person => <Person name={person.name} />)}</>
    )
  }
  return (
    <>
      <Person />
    </>
  )
}

export default Persons
